from io import BytesIO

def convert_pic(picture):
    print('start decode pic')
    # payloader = bytearray()
    payloader=''
    for packet in picture:
        tmp=packet[11:-2]
        s1 = tmp[:5]
        # s1 = int(s1.decode())-1000
        s2 = tmp[5:]
        # payloader += bytes(s2, 'utf-8')
        payloader +=s2

    fileT = open('picture/decode.jpg', "wb")
    

    # fileT.write(payloader)
    fileT.write(bytes(payloader,'utf-8'))
    fileT.close()
